🙌 Hola () => {
    const horaActual = new Date().getHours();
    let saludo;

    if (horaActual >= 5 && horaActual < 12) {
        saludo = 'buenos días';
    } else if (horaActual >= 12 && horaActual < 18) {
        saludo = 'buenas tardes';
    } else {
        saludo = 'buenas noches';
    }

    return saludo;
} Adrián Villa, bienvenido al chatbot de *Emenet*

